        color: "blue",
        fontSize: "20px"
    };

    const contentPinkStyle = {
        color: "pink",
        fontSize: "20px"
    };


    return (
        <>
            <h1 style={{color: "red"}}>こんにちは</h1>
            <p style={contentStyle}>お元気ですか？</p>
            <p style={contentPinkStyle}>元気です！</p>
            <button onClick={onClickButton}>ボタン</button>
        </>
    );
};
